textOriginal:
Propostas de  campanha do "ministri" xandi para estas eleições: 
1. xandi será eleito Imperatriz do Brasil por unanimidade;
2. após a "eleição", extinguirá tudo o que for desnecessário (ministério público, senado, câmara dos deputados, etc);
3. irá enquadrar todos os ex-coleguinhas do extinto "supremo" no inquérito 'ad aeternum' que ele mesmo pariu; 
4. e talvez revogue a lei da gravidade só de sacanagem.
Nem George Orwell teria imaginado uma distopia tão alucinante quanto a nossa realidade atual.
